import Typed from "typed.js";

export const heroLogic = () => {
  if (document.readyState !== "loading") {
    const whatAmIStrings = ["nait graduate", "coder", "dungeon master", "cat mom", "coffee addict"];
    const typedOptions = {
      strings: "strings",
      typeSpeed: 50,
      backSpeed: 50,
      loop: true,
    };
    const dynamicText = new Typed(".hero-h1-dynamic-text", whatAmIStrings, typedOptions);
    return dynamicText;
  }
};
